import styles from './CountreyPicker.module.css'

const CountryPicker = () => {



  return (
    <FormControl className={styles.formControl}>
      <NativeSelect>
        <option value="global">Global</option>
      </NativeSelect>
    </FormControl>
  )
};

export default CountryPicker;
